import classes from "./Header.module.css";

const Header = (props) => {
  return (
    <header className={classes.header}>
      <h1>Profile</h1>
      <nav>
        <ul>
          <li>
            <a href="/">Create Task</a>
          </li>
          <li>
            <a href="/">Task Lists</a>
          </li>
          <li>
            <button onClick={props.logoutHandler}>Logout</button>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
